-- Create stg_accesswire_report table
CREATE TABLE stg_accesswire_report (
    id SERIAL PRIMARY KEY,
    stitch_report_id TEXT,
    accesswire_report_id BIGINT,
    updated_at TIMESTAMP,
    accesswire_title TEXT,
    accesswire_release_type TEXT,
    pro_content_id BIGINT,
    report_date TIMESTAMP
);

ALTER TABLE stg_accesswire_report OWNER TO "user";

-- Create stg_accesswire_distribution table
CREATE TABLE stg_accesswire_distribution (
    id SERIAL PRIMARY KEY,
    get_screenshot BOOLEAN,
    stitch_report_id TEXT,
    distribution_category TEXT,
    article_url TEXT,
    distribution_point TEXT
);

ALTER TABLE stg_accesswire_distribution OWNER TO "user";

-- Create an index on stitch_report_id for both tables to improve join performance
CREATE INDEX idx_report_stitch_id ON stg_accesswire_report(stitch_report_id);
CREATE INDEX idx_distribution_stitch_id ON stg_accesswire_distribution(stitch_report_id);


